import Grid from "@mui/material/Grid";

// Material Dashboard 2 React components
import MDBox from "components/MDBox";

// Material Dashboard 2 React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";

import Footer from "examples/Footer";

import ComplexStatisticsCard from "examples/Cards/StatisticsCards/ComplexStatisticsCard";

import React, { useState, useEffect } from "react";
// Dashboard components

import { useSession } from " SessionContext";

function Dashboard() {
  const {name,pass}=useSession();
  const [totalEmployeeCount, setTotalEmployeeCount] = useState(0);
  const [totalEmployeeCseCount, setTotalEmployeeCseCount] = useState(0);
  const [totalEmployeeItCount, setTotalEmployeeItCount] = useState(0);
  const [totalEmployeeEceCount, setTotalEmployeeEceCount] = useState(0);
  const [totalEmployeeHrCount, setTotalEmployeeHrCount] = useState(0);
  const [totalEmployeeEeeCount, setTotalEmployeeEeeCount] = useState(0);
  const [totalEmployeeCivilCount, setTotalEmployeeCivilCount] = useState(0);
  const [totalEmployeeMechanicalCount, setTotalEmployeeMechanicalCount] = useState(0);
  const [totalEmployeeAdmissionCount, setTotalEmployeeAdmissionCount] = useState(0);
  const [totalEmployeePlacementCount, setTotalEmployeePlacementCount] = useState(0);
  // const [totalEmployeeCount, setTotalEmployeeCount] = useState(0);
  const fetchTotalEmployeeCount = async () => {
    try {
      const response = await fetch("http://localhost:5001/totalEmployeeCount");
      const result = await response.json();

      if (result && result.length > 0) {
        const totalEmployeeCount = result[0].totalEmployeeCount;
        setTotalEmployeeCount(totalEmployeeCount);
      } else {
        console.error("Invalid data structure received from the server:", result);
      }
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  useEffect(() => {

    fetchTotalEmployeeCount();
  }, []);


  return (
    <DashboardLayout>
      <MDBox py={3}>
        {console.log(name,pass)}
        <Grid container spacing={3}>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="dark"
                icon="weekend"
                title="Total Employee"
                count={totalEmployeeCount}
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                icon="engineering"
                title="Total Department"
                count="9"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="success"
                icon="store"
                title="HR Department"
                count="2"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="secondary"
                icon="computer" 
                title="CSE Department"
                count="10"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="light"
                icon="home" 
                title="CIVIL Depatement"
                count="10"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="error"
                icon="usb" 
                title="ECE Department"
                count="10"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="dark"
                icon="electrical_services" 
                title="EEE Department"
                count="10"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="warning"
                icon="handyman" 
                title="Mechanical Department"
                count="10"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="info"
                icon="person_4" 
                title="Freshers Department"
                count="10"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="info"
                icon="mouse" 
                title="IT Department"
                count="10"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="success"
                icon="work" 
                title="Placement Department"
                count="10"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="success"
                icon="admin_panel_settings" 
                title="Admission Office"
                count="10"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid>

        </Grid>
       </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default Dashboard;
